import React from 'react';
import { Button } from '@mantine/core';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 10rem 0;
`;
const Title = styled.h1`
  font-size: 3rem;
`;

const Home = () => {
  const navigate = useNavigate();
  const handleNavigate = () => {
    navigate('/questions');
  };
  return (
    <Wrapper>
      <Title>
        What's the best <span>tech stack</span> for your application?
      </Title>
      <p>
        Answer some questions so that we can offer recommendations that suit
        your application's needs
      </p>
      <Button
        color="cyan"
        radius="md"
        size="md"
        uppercase
        onClick={handleNavigate}>
        Start
      </Button>
    </Wrapper>
  );
};

export default Home;
